function SignupForm() {
  return(
    <div>
      <form action="#" method="post">
        <input id="name" type="text" name="name" placeholder="ユーザー名"/>
        <input id="e-mail" type="email" name="email" placeholder="ユーザー名"/>
        <textarea rows="4" id="message" placeholder="ご意見をお寄せ下さい。" name="comment"></textarea>
        <label><input type="checkbox" name="magazine" checked/>メルマガを希望する</label>
        <input type="submit"/>
      </form>
    </div>
  );
}

export default SignupForm
